            </div>
          </div>
          <div class="container" style={{paddingTop:42,paddingBottom:42}}>
            <div class="row">
              <div class="col-md-4">
                <RecentMatches/>
              </div>
            </div>
          </div>
      </MainComponent>
    )
  }

}
export default Main;
